!function(){"use strict";angular.module("app").run(["$templateCache",function(e){e.put("tmpl/player.html",'<div id="controls-1" class="navbar-text navbar-left controls"><a class="prev" title="previous" ng-click="prev()"><i class="glyphicon glyphicon-step-backward"></i></a> <a class="stop" title="stop" ng-click="stop()"><i class="glyphicon glyphicon-stop"></i></a> <a class="pause" title="pause" ng-click="playPause()"><i class="glyphicon glyphicon-pause"></i></a> <a class="play" title="play" ng-click="playPause()"><i class="glyphicon glyphicon-play"></i></a> <a class="next" title="next" ng-click="next()"><i class="glyphicon glyphicon-step-forward"></i></a></div><div id="track" ui-slider="{range: \'min\'}" min="0" max="{{session.player.audio.duration}}" step="1" ng-model="state.currentTime"></div><div id="controls-2" class="navbar-text navbar-left controls"><a title="mute (m)" ng-click="session.player.mute()"><i class="glyphicon" ng-class="{\'glyphicon-volume-up\': !session.player.audio.muted, \'glyphicon-volume-off\': session.player.audio.muted}"></i></a></div><div id="volume" ui-slider="{range: \'min\'}" use-decimals min="0" max="1.0" step="{{session.player.volumeStep}}" ng-model="state.volume"></div><div id="controls-3" class="navbar-text navbar-left controls"><a title="repeat (r)" ng-click="session.playlist.toggleRepeat()" ng-class="{\'pressed\': session.playlist.repeat}"><i class="glyphicon glyphicon-repeat"></i></a> <a title="shuffle (s)" ng-click="toggleShuffle()" ng-class="{\'pressed\': session.playlist.random}"><i class="glyphicon glyphicon-random"></i></a></div><div id="controls-4" class="navbar-text navbar-left controls"></div>'),e.put("tmpl/playlist-manager.html",'<div class="loading-label"><div>Temporarily unavailable.</div></div><div id="playlist-manager" ng-controller="PlaylistManagerController"><div class="toolbar"><h1>Saved playlists</h1><button type="button" ng-click="remove()" ng-if="selected().length > 0" title="Delete"><i class="icon-trash"></i></button></div><div class="playlists"><ul><li ng-repeat="playlist in playlistManager.playlists | orderBy: \'name\'"><div class="playlist" ng-click="select(playlist)"><div class="buttons" ng-click="$event.stopPropagation()"><button type="button" ng-click="play(playlist)" title="Play"><i class="glyphicon glyphicon-play"></i></button> <button type="button" ng-click="enqueue(playlist)" title="Enqueue"><i class="icon-reorder"></i></button> <button type="button" ng-click="savePlaylistDialog(playlist)" title="Edit"><i class="icon-edit"></i></button> <button type="button" ng-click="remove(playlist)" title="Delete"><i class="icon-trash"></i></button></div><div class="check"><i ng-class="{\'icon-check\': playlist.selected, \'icon-check-empty\': !playlist.selected}"></i></div>{{playlist.name}}</div></li></ul></div><div class="spinner spinner-large" ng-if="loading"></div></div>'),e.put("tmpl/playlist.html",'<div ng-controller="PlaylistController"><div class="toolbar"><h1>Playlist</h1><button type="button" ng-click="savePlaylistDialog()" disabled="disabled" ng-if="playlist.records.length" title="Save playlist as..."><i class="icon-save"></i></button> <button type="button" ng-click="deleteSelected()" ng-if="playlist.selectedRecords.length" title="Remove (Del)"><i class="icon-trash"></i></button> <button type="button" ng-click="clear()" ng-if="playlist.records.length" title="Clear"><i class="icon-remove"></i></button></div><div id="playlist" ng-mousedown="mousedown($event)" droppable><div class="toolbar" style="display: none"><div class="toolbar-inner"><a ng-click="openSaveDialog()" ng-mousedown="$event.stopPropagation()"><i class="glyphicon glyphicon-floppy-disk"></i></a> <a><i class="glyphicon glyphicon-trash"></i></a><div id="save-playlist-dialog" class="controls form-inline" ng-if="saveDialog" ng-mousedown="$event.stopPropagation()"><input type="text" class="form-control input-sm" ng-keydown="keydown($event)" placeholder="save playlist as..." maxlength="50" ng-model="saveName"> <a class="btn btn-primary btn-sm" ng-click="save(saveName)" ng-disabled="saveDisabled()">Save</a></div></div></div><div ng-if="playlist.loading" class="loading-label"><div><i class="glyphicon glyphicon-time"></i><span>Loading...</span></div></div><div ng-if="!playlist.loading && playlist.records.length == 0" class="loading-label"><div><i class="glyphicon glyphicon-list"></i><span>Playlist is empty</span></div></div><ul ng-class="{dragover: dragover}"><li draggable droppable ng-repeat="record in playlist.records" ng-mousedown="mousedown($event, record)" ng-mouseup="mouseup($event, record)" ng-dblclick="dblclick($event, record)" ng-class="{current: record == player.currentRecord, selected: record.selected, dragover: record.dragover, disabled: !record.item.client || !record.item.client.isLoggedIn()}"><span><i class="glyphicon glyphicon-time"></i><i class="glyphicon glyphicon-play"></i><i class="glyphicon glyphicon-pause"></i>&nbsp;{{record.item.name}}</span></li></ul></div></div>'),e.put("tmpl/save-playlist-modal.html",'<div id="save-playlist-modal"><div class="modal-header"><button type="button" class="close" aria-label="Close" ng-click="cancel()"><span aria-hidden="true">&times;</span></button><h3 class="modal-title">{{title}}</h3></div><div class="modal-body"><input type="text" id="save-playlist-name" class="form-control" ng-keydown="saveKeydown($event)" placeholder="playlist name..." maxlength="50" ng-model="name"></div><div class="modal-footer"><div class="buttons"><span class="spinner" ng-if="loading"></span> <button class="btn btn-primary" ng-click="ok(name)" ng-disabled="!name">OK</button> <button class="btn btn-default" ng-click="cancel()">Cancel</button></div></div></div>'),e.put("tmpl/tree.html",'<script type="text/ng-template" id="node.html"><div ng-class="{collapsed: node.collapsed, \'shared\': node.item.shared}">\n        <a ng-if="node.item.type !== \'file\'" ng-click="toggleDir(node)"><i class="glyphicon glyphicon-plus" ng-class="{\'glyphicon-minus\': !node.collapsed}"></i><i class="glyphicon glyphicon-folder-close" ng-class="{\'glyphicon-folder-open\': !node.collapsed}" ng-if="node.item.type === \'dir\'"></i><i class="glyphicon glyphicon-root" ng-if="node.item.type === \'root\'"></i></a>\n        <i ng-if="node.item.type === \'file\'" class="glyphicon glyphicon-file"></i>\n        <span draggable class="tree-label" ng-class="{selected: node.selected}" ng-mousedown="mousedown($event, node)" ng-dblclick="dblclick($event, node)">{{node.item.name}}</span>\n        <div ng-if="node.item.type !== \'file\' && !node.collapsed && node.loading" class="loading">Loading...</div>\n        <ul ng-if="node.item.type !== \'file\'">\n            <li ng-repeat="node in node.children" ng-include="\'node.html\'"></li>\n            <li ng-if="node.item.type === \'root\' && node.empty"><i>no files</i></li>\n        </ul>\n    </div></script><ul class="tree"><li ng-repeat="node in tree.roots" ng-include="\'node.html\'" class="tree-item tree-root tree-root-{{node.item.client.name}}"></li></ul>'),e.put("partials/accounts.html",'<ul class="dropdown-menu" ng-controller="AccountsController"><li ng-if="loading">Loading...</li><li ng-repeat="service in services" class="{{service.name}}"><i></i><div><div class="button"><button type="button" ng-if="!service.loggedIn" ng-click="login(service.name)">Login</button> <button type="button" ng-if="service.loggedIn" ng-click="logout(service.name)">Logout</button></div><h4>{{service.title}}</h4><div ng-if="service.loggedIn"><p class="username">{{service.user}}</p><p class="stats">{{service.stats}}</p></div></div></li></ul>'),e.put("partials/help.html",'<div id="text"><h3>Browser support</h3><p>MQ is powered by HTML5 <b>&lt;audio&gt;</b> tag which means you\'ll need one of the modern browsers that support HTML5:</p><table id="browsers"><tr class="br"><td></td><td><span class="ie">Internet Explorer *</span></td><td><span class="cr">Chrome</span></td><td><span class="op">Opera</span></td><td><span class="sa">Safari **</span></td><td><span class="fx">Firefox</span></td><td><span class="an">Android</span></td><td><span class="ip">iOS</span></td></tr><tr><td>HTML5 Support</td><td class="yes"><span>9.0+</span></td><td class="yes"><span>3.0+</span></td><td class="yes"><span>10.5+</span></td><td class="yes"><span>3.1+</span></td><td class="yes"><span>3.5+</span></td><td class="yes"><span>2.2+</span></td><td class="yes"><span>3.0+</span></td></tr><tr><td>MQ tested</td><td class="yes"><span>9.0+</span></td><td class="yes"><span>35.0</span></td><td class="no"><span></span></td><td class="no"><span></span></td><td class="yes"><span>29.0+</span></td><td class="no"><span></span></td><td class="no"><span></span></td></tr></table><br><p>*<b>Internet Explorer</b> users must add an exception to the Privacy settings to allow using cookies for the "google.com" domain: 1) Go to Tools->Internet Options->Privacy->Sites 2) Enter "google.com" and press "Allow" button.</p><p>**<b>Safari</b> users must have Quick Time installed to enable HTML5 <b>&lt;audio&gt;</b> feature.</p><p>Please, also note, to use MQ the Javascript must be enabled in your browser.</p><br><h3>Shortcuts</h3><table id="shortcuts"><tr><th><kbd>x</kbd></th><td>Play</td></tr><tr><th><kbd>c</kbd></th><td>Play/pause</td></tr><tr><th><kbd>mum 8</kbd></th><td>Volume up</td></tr><tr><th><kbd>mum 2</kbd></th><td>Volume down</td></tr><tr><th><kbd>num 4</kbd>, <kbd>←</kbd></th><td>Play previous track</td></tr><tr><th><kbd>num 6</kbd>, <kbd>→</kbd></th><td>Play next track</td></tr><tr><th><kbd>del</kbd></th><td>Delete selected tracks from playlist</td></tr><tr><th><kbd>m</kbd></th><td>Mute</td></tr><tr><th><kbd>r</kbd></th><td>Repeat</td></tr><tr><th><kbd>s</kbd></th><td>Shuffle</td></tr></table><br><br><h4>Contacts</h4><p>Email: alec.kravets@gmail.com</p><p>Issue tracker: <a href="https://github.com/aleckravets/mqplayer/issues">Issues</a></p><p>Twitter: <a href="https://twitter.com/mqplayer">@mqplayer</a></p><p>Facebook: <a href="https://www.facebook.com/mqplayer">MQ Player</a></p></div>'),e.put("partials/home.html",'<div><div ng-if="session.loggedIn() === undefined" id="loading" class="loading-label"><div><i class="glyphicon glyphicon-headphones"></i><span>Loading...</span></div></div><div ng-if="session.loggedIn() === false" id="login" ng-include="\'partials/login.html\'"></div><div ng-if="session.loggedIn()" ng-include="\'partials/player.html\'" onload="restoreBarWidths()"></div></div>'),e.put("partials/login.html",'<h1>Cloud music player</h1><div id="login-box"><p>Choose the cloud storage to play your music from:</p><a ng-click="login(\'drive\')" class="drive"><div><i></i>Google Drive</div></a> <a ng-click="login(\'dropbox\')" class="dropbox"><div><i></i>Dropbox</div></a></div>'),e.put("partials/openFromDrive.html",'<div ng-if="loading" id="loading" class="loading-label"><div><i class="glyphicon glyphicon-headphones"></i><span>Loading...</span></div></div><div ng-if="!loading" id="text"><p>You are trying to play files from Google Drive. Please log in to continue. <button ng-click="login()">Login with Google</button> <button ng-click="cancel()">Cancel</button></p></div>'),e.put("partials/player.html",'<div id="content-wrapper"><div id="content-col-wrapper"><div id="content-col" class="col"><div id="resize-bar-left" class="resize-bar" ng-mousedown="resizeBarMousedown($event)"></div><div id="resize-bar-right" class="resize-bar" ng-mousedown="resizeBarMousedown($event)"></div><div class="col-inner"><ng-include src="\'tmpl/playlist.html\'"></div></div></div><div id="left-col" class="col"><div class="col-inner"><tree></tree></div></div><div id="right-col" class="col"><div class="col-inner"><ng-include src="\'tmpl/playlist-manager.html\'"></div></div></div>')}])}();